B.hq=new A.b4(B.MB,["Our app is all about empowering women by offering personalized workout plans that sync with their menstrual cycle. We use advanced AI technology to ensure you get the best fitness results.","The app creates customized workout plans based on your menstrual cycle and fitness goals. It also tracks your progress and adjusts the workouts to match your hormonal cycle phases.",'Yes, the app has a free version with basic features. If you want more advanced features, like workout regeneration and customization, you can upgrade to our premium version. See more at "Pricing"',"You can input your menstrual cycle data in the app's tracking section. The app will then customize your workout plans according to different cycle phases.",'Yes, you can select your health conditions in the "Health conditions" settings, and we will tailor your workout plans to ensure they are safe and effective for you.'],t.l)
